import React from "react";
import ReactDOM from "react-dom";
var fname,lname;
fname="mujjkir";
lname="ansari";
var i=2;
var j="i have ";
var m,n;
m=10;n=9;
var key=()=>{
   console.log(j)
   
   return (
      <>
      <h1>{m+n}</h1>
      <h1>{fname}{lname}</h1>
    
   </>)

}



ReactDOM.render(
   <>
    <h1>my name is  {`${fname} ${lname} ${i} ${j} legs`}</h1>
    {key}
    </>
 ,document.getElementById("root"));
